script: |
  super -f text -I q8925.spq | sort > q8925.out

inputs:
  - name: q8925.spq
    data: |
      SELECT ALL - + col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 * + 77 < + 77 * + col1 - col0 + + - CAST ( NULL AS REAL );
  - name: tab1

outputs:
  - name: q8925.out
    data: |
